import styled from "styled-components";

export const Wrapper = styled.div `

display: flex;
min-width: 100px;


.search-icon{
position: absolute;
top: 6px;
left: 8px;
width: 14px;
}

.clear-icon{
position: absolute;
top: 8px;
right: 8px;
width: 10px;
cursor: pointer;
}

.search{
border : 1px solid ;
border-radius: 5px;
height: 30px;
width: 250px;
padding: 2px 23px 2px 30px;
outline: 0;

}
`;
